import './App.css';
import { Route, Switch } from 'react-router-dom';
import MainPage from './Pages/MainPage';
import FormsPage from './Pages/FormsPage';

function App() {
  return (
    <Switch>
      <Route path="/" component={ MainPage } exact />
      <Route path="/forms" component={ FormsPage } />
    </Switch>
  );
}

export default App;
